import React, { useState } from 'react';
import './App.css';
import Expenses from './components/Expenses';
import Salary from './components/Salary';
import Groceries from './components/Groceries';
import ProteinTracker from './components/ProteinTracker';
import WaterTracker from './components/WaterTracker';

function App() {
  const [activeTab, setActiveTab] = useState('expenses');

  const renderContent = () => {
    switch (activeTab) {
      case 'expenses':
        return <Expenses />;
      case 'salary':
        return <Salary />;
      case 'groceries':
        return <Groceries />;
      case 'protein':
        return <ProteinTracker />;
      case 'water':
        return <WaterTracker />;
      default:
        return <Expenses />;
    }
  };

  return (
    <div className="app-container">
      <header className="app-header">
        <h1>My Homemaker</h1>
        <p>Your personal assistant for daily life management</p>
      </header>
      <nav className="app-tabs">
        <button
          className={activeTab === 'expenses' ? 'active' : ''}
          onClick={() => setActiveTab('expenses')}
        >
          Expenses
        </button>
        <button
          className={activeTab === 'salary' ? 'active' : ''}
          onClick={() => setActiveTab('salary')}
        >
          Income
        </button>
        <button
          className={activeTab === 'groceries' ? 'active' : ''}
          onClick={() => setActiveTab('groceries')}
        >
          Groceries
        </button>
        <button
          className={activeTab === 'protein' ? 'active' : ''}
          onClick={() => setActiveTab('protein')}
        >
          Protein Tracker
        </button>
        <button
          className={activeTab === 'water' ? 'active' : ''}
          onClick={() => setActiveTab('water')}
        >
          Water Tracker
        </button>
      </nav>
      <main className="app-content">
        {renderContent()}
      </main>
      <footer className="app-footer">
        <p>My Homemaker &copy; {new Date().getFullYear()}</p>
      </footer>
    </div>
  );
}

export default App;
